import React from "react"
import RsvpListItem from './RsvpListItem';

export default function RsvpList(props) {

    let i = 0;

    const list = props.list.map(person => {
        i++;
        return <RsvpListItem person={person}
            key={person.name}
            onClick={() => props.setSelected(person)}
            num={i} />
    })

    return (
        <ul className="rsvpList">
            <li className="rsvpListItem">
                <p className="title">Name</p>
                <p className="title">Email</p>
                <p className="title">Response</p>
            </li>
            {list}
        </ul>
    )
}
